svg.script:

document.addEventListener('DOMContentLoaded', function () {
    const channel = new BroadcastChannel('svg_channel');
    const popBubble = new BroadcastChannel('bubble');

    const toadElement = document.getElementById('textToad');
    const codeElement = document.getElementById('textCode');
    const inElement = document.getElementById('textIn');

    let hasPlayed = false;

    function playAnimations() {
        if (!hasPlayed) {
            for (let i = 1; i <= 14; i++) {
                const animation = document.getElementById(`morphAnim${i}`);
                if (animation) {
                    animation.beginElement(); // Start the animation
                }
            }
            toadElement.style.opacity = '1';
            codeElement.style.opacity = '1';
            inElement.style.opacity = '1';

            hasPlayed = true;

            popBubble.postMessage(hasPlayed);
            setTimeout(() => {
                const frameElement = document.getElementById('frame');
                const bondBox = frameElement.getBoundingClientRect();
                const coordinates = {
                    x: bondBox.x,
                    y: bondBox.y,
                    width: bondBox.width,
                    height: bondBox.height
                };
                <!-- console.log('SVG: Sending bounding rectangle:', coordinates); -->
                channel.postMessage(coordinates);

                document.getElementById('mySvg').style.cursor = 'default';
            }, 1000);
        }
    }

    document.getElementById('mySvg').addEventListener('click', playAnimations);
});
